import React from "react";
import { Card, CardContent } from '@mui/material';
import { color } from '@mui/system';
import Color from 'color';

function WhiteCard({ children, marginTop}){
    return(
        <Card sx={{ 
            display: "inline-block", 
            backgroundColor: Color(white).alpha(0.1).string(),
            marginTop: {marginTop},
            borderRadius: 5,
        }}
        >
            <CardContent>
                {children}
            </CardContent>
        </Card>
    );
}

export default WhiteCard;
